<node CREATED="1566214826971" ID="ID_1570639206" MODIFIED="1566214826971" TEXT="Social Stories are a social learning tool that supports the safe and meaningful exchange of information between parents professionals and people with autism of all ages. The people who develop Social Stories are referred to as Authors and they work on behalf of a child adolescent or adult with autism the Audience. Authors follow a [&#226;&#8364;&#166;]" />
</node>
<node CREATED="1566214826971" FOLDED="true" ID="ID_1081800820" LINK="https://www.pbisworld.com/tier-2/social-stories/" MODIFIED="1566214826971" TEXT="Social Stories - pbisworld.com">
<node CREATED="1566214826971" ID="ID_1668746039" MODIFIED="1566214826971" TEXT="PBISWorld Tier 2 interventions are more targeted and individualized behavior strategies. Social Stories are a highly effective way to teach social norms routines and skills. Many students including immature autistic and ADD/ADHD can more quickly pick up on social and behavioral expectations through social stories." />
</node>
<node CREATED="1566214826971" FOLDED="true" ID="ID_1426101420" LINK="https://www.rchsd.org/programs-services/autism-discovery-institute/hospital-visit-tips/social-stories/" MODIFIED="1566214826971" TEXT="Social Stories - Rady Childrens Hospital">
<node CREATED="1566214826971" ID="ID_480107495" MODIFIED="1566214826971" TEXT="Social Stories. A social story is one way to prepare your child for an upcoming activity or event that is otherwise unfamiliar or unexpected. We have provided several sample social stories for specific procedures and a template below to help you customize a story specific to your child&#226;&#8364;&#8482;s situation." />
</node>
<node CREATED="1566214826971" FOLDED="true" ID="ID_940586651" LINK="https://www.iidc.indiana.edu/pages/Behavioral-Issues-and-the-Use-of-Social-Stories" MODIFIED="1566214826971" TEXT="Behavioral Issues and the Use of Social Stories">
<node CREATED="1566214826971" ID="ID_1438967313" MODIFIED="1566214826971" TEXT="Behavioral Issues and the Use of Social Stories. Contributed by Beverly Vicker. A frequent positive programming recommendation for an individual with autism Aspergers syndrome or other pervasive developmental disorders is that the family or the staff of an agency develop one or more social stories to present particular information or to address specific situations." />
</node>
<node CREATED="1566214826971" FOLDED="true" ID="ID_1347127377" LINK="https://carolgraysocialstories.com/social-stories/social-story-sampler/" MODIFIED="1566214826971" TEXT="Social Story Sampler - Carol Gray - Social Stories">
<node CREATED="1566214826972" ID="ID_328625990" MODIFIED="1566214826972" TEXT="The Stories introduce a concept that echoes throughout The Social Story Sampler: autism is a personal factor but it never defines who someone is. Story 6 contains more detail. Please note: Stories in The Sampler assume that readers with autism are aware of their diagnosis and understand it at a basic level. 7." />
